id = "RN030"
question = "Vad anser regeringen är viktigt när det gäller användning av undervisningsmaterial?"
answer = "Regeringen anför bl.a. att det är viktigt att sträva mot en balans mellan olika undervisningsmaterial som t.ex. läroböcker, andra läromedel, fack- och skönlitteratur, olika former av autentiska texter, digitala presentationer, film, material för skapande, laborationsutrustning och annan utrustning"
