[[questions]]
id = "RN036"
question = "Vad gäller för elever i komvux när det gäller att bekosta läromedel?"
answer = "Inom komvux på grundläggande och gymnasial nivå samt inom komvux som anpassad utbildning på grundläggande och gymnasial nivå får huvudmannen bestämma att böcker och andra lärverktyg som eleverna har för eget bruk och får behålla som sin egendom ska anskaffas av eleverna själva eller erbjudas mot avgifter som högst motsvarar huvudmannens anskaffningskostnader"
difficulty = "Easy"
category = "Education"
